import React from "react";
import { NavDash, Main } from "../components/dashboard";

function Dashboard() {
  return (
    <div>
      <header>
        <NavDash />
      </header>
      <main>
        <Main />
      </main>
      <footer></footer>
    </div>
  );
}

export default Dashboard;
